    "2016-10-03T22:18:53.545084",nt"name": "marine-invertebrate-pathology-and-other-data-from-the-miller-freeman-as-part-of-the-outer-conti",nt"isopen":
    false,nt"url": null,nt"notes": "Marine invertebrate pathology and other
    data were collected from NOAA Ship MILLER FREEMAN. Data were collected by the Pacific
    Marine Environmental Laboratory (PMEL) as part of Outer Continental Shelf Environmental
    Assessment Program (OCSEAP) from 24 August 1976 to 13 October 1976. Data were processed
    by NODC to the NODC standard F063 Marine Invertebrate Pathology format. Full format
    description is available from the NODC homepage at www.nodc.noaa.gov/. An analog
    file for this accession is available from NODC user services.nnThe F063 format contains
    data from examinations of diseased marine invertebrates. Although these data maybe
    from field observations, they derive primarily from laboratory analyses. Data include:
    catch statistics (e.g., total weight, number of individual, identity of disease
    and number of diseased individuals) by species for any number of species; and biological
    condition of selected specimens. The size location, and frequency of lesions may
    be reported for individual specimens. Specimens are identified by an NODC Taxonomic
    Code. A text record is available for comments.",nt"license_title": null,nt"extras":
